/*Table structure for table `tb_klasifikasi` */

DROP TABLE IF EXISTS `tb_klasifikasi`;

CREATE TABLE `tb_klasifikasi` (
  `id_klasifikasi` int(250) NOT NULL,
  `nama_dataset` varchar(100) DEFAULT NULL,
  `nilai_fknn` float DEFAULT NULL,
  `hasil_klasifikasi` varchar(50) DEFAULT NULL,
  `status_klasifikasi` varchar(50) DEFAULT NULL,
  `id_dataset` int(250) DEFAULT NULL,
  `id_jenis` int(100) DEFAULT NULL,
  PRIMARY KEY (`id_klasifikasi`),
  KEY `id_jenis` (`id_jenis`),
  KEY `id_dataset` (`id_dataset`),
  CONSTRAINT `tb_klasifikasi_ibfk_1` FOREIGN KEY (`id_jenis`) REFERENCES `tb_jenis` (`id_jenis`),
  CONSTRAINT `tb_klasifikasi_ibfk_2` FOREIGN KEY (`id_dataset`) REFERENCES `tb_dataset` (`id_dataset`)
